widget.on("render", function (w, e) {
  e.prefixText = "";
  e.suffixText = "";
  e.selectedColor = "#0E788F"; /*The color of the chosen title*/
  e.fontColor = "#828282"; /*The color of the unchosen titles*/
  e.elementWidth = "103%";
  e.descColor = "#a5a5a5";
  e.parentMarginLeft = "-15px";
  e.height = 32; /* affects the tabber widget default high*/
});

overalltotalsIds = [
  "662979e27529970040f144aa",
  "662979da7529970040f144a6",
  "662c395a7529970040f14a37"
];


performanceIds = [
  "662979de7529970040f144a8",
  "662ab7f27529970040f146d1",
  "662c3cbd7529970040f14a49",
  "662f37a57529970040f14b9f",
  "662fa2c27529970040f14caf"
];


allIds = [
  ...overalltotalsIds,
  ...performanceIds,
]


widget.tabs = [
  {
    title: "Overall Totals",
    displayWidgetIds: overalltotalsIds,
    hideWidgetIds: allIds.filter(n => !overalltotalsIds.includes(n)),
  },

  {
    title: "Progress & Performance",
    displayWidgetIds: performanceIds,
    hideWidgetIds: allIds.filter(n => !performanceIds.includes(n)),
  },

];

widget.style.activeTab = widget.tabs.findIndex(el => el.title == "Overall Totals")
